import axios from "axios"
import { useEffect, useState } from "react"
import { toast } from "react-toastify"
import FoodItem from "../../../components/FoodItems/foodItem"
import Header1 from "../../../components/Header1/header1"

const BestSeller = () => {
    const { foodItems, setFoodItems } = useState([])
    const { cuisineId } = sessionStorage
    useEffect(() => {
        getfoodItems()
      }, [])
    
      const url = `${URL}/user/fooditems/${cuisineId}`
    
      const getfoodItems = () => {
    
        axios.get(url).then((response) => {
          const result = response.data
          if (result.status === 'success') {
            setFoodItems(result.data)
            console.log()
          } else {
            console.log(result.error)
            toast.error(result['error'])
          }
        })
      }
    return <div className="container">
        <Header1></Header1>
        <div className="cuisine-tabs">

        </div>
        <div className="food-items">
            {foodItems.map((foodItem)=>{return <FoodItem FoodItem={foodItem}></FoodItem>})}
        </div>
    </div>
}

export default BestSeller
